INSERT INTO `expo` (`id`, `title`, `maps`, `image`, `dias_horarios`, `plano`, `reglamento`, `como_participar`, `alojamiento`, `prensa`, `body`, `teaser`, `img_acr`, `text_acr`, `fecha_inicio`, `fecha_fin`, `status`) VALUES
(001, '"Expohobby 7" Todo el arte manual, en un solo lugar...', 'a', 'upload_images/465c99e8250ffb639019d4996ae1cd04.jpg', 'Miércoles 9 al sábado 12 de Abril 2014', 'upload_images/6d99ec61d7a349990c2f42cf7e88ae32.jpg', '<p><strong>REGLAMENTO DE PARTICIPACI&Oacute;N </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&ldquo;Expohobby&rdquo; Todo el arte manual en un solo lugar&hellip;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Este reglamento toca los siguientes puntos:</p>\r\n\r\n<p>1 - Armado de la muestra.</p>\r\n\r\n<p>2 - Desarme de la muestra.</p>\r\n\r\n<p>3 - &Aacute;reas del evento.</p>\r\n\r\n<p>4 - Servicios Inclu&iacute;dos.</p>\r\n\r\n<p>5 - Opciones publicitarias.</p>\r\n\r\n<p>6 - Concurso &ldquo;Expohobby&rdquo;.</p>\r\n\r\n<p>7 &ndash; Pol&iacute;tica de reservas y devoluciones.</p>\r\n\r\n<p>8 - Generalidades.</p>\r\n\r\n<p>9 - Legal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1 - Armado de la muestra:</p>\r\n\r\n<p>Es importante respetar el cronograma de armado informado por el grupo organizador, este permitir&aacute; un &aacute;gil descargue de los fletes y el cuidado necesario de las piezas en exposici&oacute;n, rogamos respetar este cronograma respetando al resto de los expositores.</p>\r\n\r\n<p>El personal (mayores y/o menores de edad) que se encuentre afectado al armado, atenci&oacute;n y desarme del stand o mesa expositora se encontrar&aacute; bajo la responsabilidad f&iacute;sica y legal del titular responsable de la reserva.</p>\r\n\r\n<p>Si el expositor no ocupa su espacio el d&iacute;a asignado para el armado, la organizaci&oacute;n lo considerar&aacute; ausente de la muestra y&nbsp;dispondr&aacute; del mismo a su criterio, re-asign&aacute;ndolo a terceros o utiliz&aacute;ndolo para exposici&oacute;n de piezas, sin posibilidad de reclamo de ning&uacute;n tipo por parte del expositor.</p>\r\n\r\n<p>El stand consiste en un espacio libre, sin paneles divisorios en el sector elegido en el momento de la reserva.</p>\r\n\r\n<p>Altura m&aacute;xima de muebles y carteles ser&aacute; de acuerdo a la ubicaci&oacute;n del stand.</p>\r\n\r\n<p>La participaci&oacute;n obliga al expositor a ocupar el espacio que le ha sido asignado y a mantenerlo debidamente presentado y atenderlo por personal capacitado que asista al p&uacute;blico en los horarios dispuestos por la organizaci&oacute;n hasta la clausura de la misma.</p>\r\n\r\n<p>La muestra abre puntualmente en el horario establecido y la no presencia de personal en el stand en dicho horario no admite reclamos por faltantes de mercader&iacute;a que no podr&aacute;n imputarse al organizador a pesar de tener personal de seguridad en la muestra.</p>\r\n\r\n<p>Ante la necesidad de requerir ayuda del personal de mantenimiento, solic&iacute;telo al grupo organizador</p>\r\n\r\n<p>2 - Desarme de la muestra:</p>\r\n\r\n<p>El desarme se realizar&aacute; el &uacute;ltimo d&iacute;a de la muestra a partir de las 20:00 hrs. <strong>NO ESTA PERMITIDO COMENZAR A DESMONTAR ANTES DE LA HORA INDICADA Y ANUNCIADO POR LOS ORGANIZADORES.</strong></p>\r\n\r\n<p>El ingreso de personal para el desarme ser&aacute; permitido a partir de las 20.30 Hs. Como as&iacute; tambi&eacute;n el retiro de cajas y muebles.</p>\r\n\r\n<p>Los espacios deben devolverse en las mismas condiciones que se recibieron, todo da&ntilde;o causado en las instalaciones podr&aacute;n ser derivados a la empresa causante del mismo.</p>\r\n\r\n<p>3 - &Aacute;reas del evento:</p>\r\n\r\n<p>Existen dos &aacute;reas dentro del evento:</p>\r\n\r\n<p>Empresas y Talleres: Estos espacios est&aacute;n a disposici&oacute;n de las empresas ocupantes para realizar las tareas de comercializaci&oacute;n de insumos, piezas terminadas, actividades demostrativas o participativas.</p>\r\n\r\n<p>&Aacute;rea expositora: Este espacio est&aacute; destinado a la exhibici&oacute;n de muestras terminadas, <strong>QUEDANDO EXPRESAMENTE PROHIBIDA LA COMERCIALIZACI&Oacute;N DE DICHO MATERIAL</strong>. Pudiendo publicitar su actividad a trav&eacute;s de folleter&iacute;a alusiva. Estas mesas cuentan con manteler&iacute;a&nbsp;b&aacute;sica&nbsp;<strong>SIN INSTALACI&Oacute;N ELECTRICA.</strong> Toda la ornamentaci&oacute;n no podr&aacute;&nbsp;exceder los bordes de la mesa ni superar 1,2 mts. de altura.</p>\r\n\r\n<p>4 - Servicios incluidos:</p>\r\n\r\n<p>En Stands Comerciales:</p>\r\n\r\n<p>Acceso a conexi&oacute;n el&eacute;ctrica, iluminaci&oacute;n general del sal&oacute;n, 2 sillas, 1 mesa (<strong>SIN MANTEL)</strong></p>\r\n\r\n<p>En Stands de Talleres:</p>\r\n\r\n<p>Acceso a conexi&oacute;n el&eacute;ctrica, iluminaci&oacute;n general del sal&oacute;n, 6 sillas, 1 mesa (<strong>SIN MANTEL)</strong></p>\r\n\r\n<p>Mesas Expositora:</p>\r\n\r\n<p>Mesa redonda de 1,5 mts. De di&aacute;metro con manteler&iacute;a b&aacute;sica.</p>\r\n\r\n<p>Servicios comunes:</p>\r\n\r\n<p>Limpieza nocturna de los espacios comunes, Guardarropas, Valet de ba&ntilde;os, seguridad, bombero, cobertura m&eacute;dica, seguro.</p>\r\n\r\n<p>5 - Opciones publicitarias:</p>\r\n\r\n<p>Programa &ldquo;Expohobby&rdquo;: Opci&oacute;n preferencial de anunciar en el programa de la muestra.</p>\r\n\r\n<p>Todas las empresas participantes recibir&aacute;n entradas de cortes&iacute;a sin cargo.</p>\r\n\r\n<p>En la p&aacute;gina www.expohobby.net se ha incluido un plano de c&oacute;mo llegar a la muestra, puede agregarlo a su p&aacute;gina web cuando anuncie su presencia en la muestra.</p>\r\n\r\n<p>6 - Concurso &ldquo;EXPOHOBBY&rdquo;</p>\r\n\r\n<p>Durante el primer d&iacute;a del evento se har&aacute; entrega a todo el p&uacute;blico visitante de un cup&oacute;n para la votaci&oacute;n de las tres categor&iacute;as concursantes: Obra en exposici&oacute;n m&aacute;s destacada / Mesa en exposici&oacute;n mejor ambientada / Stand mejor decorado.</p>\r\n\r\n<p>7 &ndash; Pol&iacute;tica de reservas y devoluciones:</p>\r\n\r\n<p>La reserva del espacio elegido se realizar&aacute; dentro de la fecha estipulada por los organizadores, la cancelaci&oacute;n del saldo de los espacios y servicios contratados ser&aacute; con un plazo de 15 d&iacute;as anteriores al evento correspondiente. Toda devoluci&oacute;n de reserva o pago anticipado se realizar&aacute; una vez finalizado el evento y mediante la siguiente escala de descuento:</p>\r\n\r\n<p>(180 d&iacute;as: - 20%), (150 d&iacute;as: -30%), (120 d&iacute;as: -40%), (90 d&iacute;as: -50%) pasado este plazo no se realizar&aacute;n devoluciones, sin lugar a reclamo.</p>\r\n\r\n<p>8 - Generalidades:</p>\r\n\r\n<p>8.1 Al colocar paneles divisorios deben estar prolijamente pintados tanto del lado interior de su stand como del lado que enfrenta al stand vecino.</p>\r\n\r\n<p>8.2 Los pasillos comunes no pueden ser interrumpidos en su circulaci&oacute;n, si va a dar demostraciones considere el espacio necesario para no interrumpir el tr&aacute;nsito del p&uacute;blico. La gente deber&aacute; estar dentro del per&iacute;metro del stand.</p>\r\n\r\n<p>8.3 Toda la mercader&iacute;a deber&aacute; estar dentro de su stand y&nbsp;no podr&aacute; sobresalir ni apoyarse en los espacios de circulaci&oacute;n.&nbsp;Tampoco se podr&aacute; colgar ning&uacute;n elemento publicitario fuera del per&iacute;metro del stand.</p>\r\n\r\n<p>8.4 No est&aacute; permitido entregar volantes o cualquier otro tipo de publicidad ni vender fuera del espacio de su stand.</p>\r\n\r\n<p>8.5 El ingreso de mercader&iacute;a estar&aacute; prevista 1 hora antes del horario de apertura de cada d&iacute;a del evento.</p>\r\n\r\n<p>8.6 No se puede obstaculizar con elementos pesados las instalaciones de emergencias como salidas, extinguidores de fuego y zonas comunes de circulaci&oacute;n.</p>\r\n\r\n<p>8.7 Durante toda la muestra el personal de la organizaci&oacute;n estar&aacute; a su disposici&oacute;n para solucionar eventuales inconvenientes, podr&aacute;n pedir asistencia en la zona de boleter&iacute;a o el sector de informes y locuci&oacute;n.</p>\r\n\r\n<p>8.8 La muestra cuenta con un locutor ubicado en un espacio com&uacute;n, tenga bien la precauci&oacute;n de armar un listado de anuncios con la hora requerida para facilitar su trabajo.</p>\r\n\r\n<p>8.9 Recuerde que todo elemento de embalaje que Ud. deje en los pasillos comunes, ser&aacute;n retirados como basura al finalizar el d&iacute;a.</p>\r\n\r\n<p>9 - Legal:</p>\r\n\r\n<p>9.1 Los expositores est&aacute;n obligados a asegurar el material y mercader&iacute;a que expongan as&iacute; sean de su propiedad o de terceros y renuncian a toda acci&oacute;n legal para obtener indemnizaci&oacute;n por accidentes personales, incendios, tempestad, hurtos, inundaci&oacute;n, explosi&oacute;n, conmoci&oacute;n civil, sabotaje, atentado u otro siniestro en contra de los organizadores.</p>\r\n\r\n<p>9.2 El expositor no podr&aacute; ceder, arrendar ni sub-alquilar total&nbsp;o parcialmente el espacio adquirido. En la eventualidad de que esto sucediere, la organizaci&oacute;n puede invitar a retirarse a las personas que no tienen autorizaci&oacute;n para comerciar dentro de los stands.</p>\r\n\r\n<p>9.3 Solo est&aacute;n autorizados a realizar ventas dentro de la muestra, aquellas personas que hayan comprado un stand.</p>\r\n\r\n<p>9.4 El expositor se obliga al pago de los da&ntilde;os que pudieran derivarse de su responsabilidad extracontractual frente a terceros sin que la organizaci&oacute;n asuma responsabilidad alguna sobre dichos hechos.</p>\r\n\r\n<p>9.5 Los expositores no podr&aacute;n modificar las condiciones expresadas en este Reglamento y deben acatarlas desde el momento en que abonan el derecho de reserva, reconociendo este momento como una declaraci&oacute;n jurada del conocimiento del presente Reglamento.</p>\r\n\r\n<p>9.6 El lugar elegido para el desarrollo de la muestra, cumple con todos los requisitos exigidos por la Municipalidad de la Ciudad aut&oacute;noma de Buenos Aires con respecto a seguridad e incendios. Preste atenci&oacute;n a la ubicaci&oacute;n de los matafuegos y salidas de emergencias m&aacute;s cercanas a su ubicaci&oacute;n. En la eventualidad de un imprevisto, nuestro personal dar&aacute; las instrucciones y lo dirigir&aacute; a las salidas de emergencia.</p>\r\n\r\n<p>9.7 Contamos con un servicio de vigilancia, no obstante ni este servicio ni los organizadores asumen responsabilidad por los objetos que se pierdan dentro de los stands, rogamos prever espacio donde ubicar los valores y elementos personales a resguardo. No est&aacute; permitida la permanencia en los stands despu&eacute;s de media hora posterior al cierre. Rogamos muy especialmente este tema por la seguridad de todos los elementos dentro de los stands. No comprometa al personal de seguridad con una permanencia m&aacute;s all&aacute; de este horario.</p>\r\n\r\n<p>9.8 El Reglamento toma en cuenta el mejor funcionamiento y las necesidades de todos los expositores.</p>\r\n\r\n<p>9.9 Las empresas que realicen una actividad comercial, recuerden llevar siempre su comprobante de inscripci&oacute;n tributaria y su correspondiente talonario de facturas.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>LA COMPRA Y PAGO DEL STAND COMERCIAL O MESA EXPOSITORA IMPLICA LA ACEPTACI&Ograve;N DE ESTE REGLAMENTO Y TENDR&Aacute; EFECTO LEGAL COMO UN CONTRATO. EL NO CUMPLIMIENTO DE ALGUNA CLAUSULA QUE FIGURE EN ESTE REGLAMENTO, HABILITAR&Aacute; AL ORGANIZADOR A EFECTUAR LA SANCI&Oacute;N CORRESPONDIENTE</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ante cualquier consulta, no dude en contactarse con la organizaci&oacute;n</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Gracias.</p>\r\n', '<p>como participar.........................</p>\r\n', '<p>Hoteles cercanos&nbsp;</p>\r\n\r\n<p>Hoteles cercanos&nbsp;</p>\r\n\r\n<p>Hoteles cercanos&nbsp;</p>\r\n\r\n<p>Hoteles cercanos&nbsp;</p>\r\n', '<p>datos p&agrave; la prensa&nbsp;</p>\r\n', '<p>expo expo expo larga</p>\r\n', '<p>expo corta</p>\r\n', 'acreditacion/img/entradaDES.jpg', '* Cupón con 50% de descuento, personal e intransferible, válida presentando D.N.I o Cedula de identidad.\r\n* Menores de 6 años entrada sin cargo.\r\n* No valida para el dia Domingo Septiembre 2014\r\n* Expohobby se reserva el derecho de admisión y permanencia.\r\n* Prohibida su reproducción y comercialización', '2014-04-09', '2014-04-12', 'Publicado'),
(002, '"Expohobby" Fiestas y Decoración 2014', 'aa', 'upload_images/1b06bd6c9273132c1f937dc5a2d5e969.jpg', 'Del Jueves 18 al Sábado 20 de septiembre de 13 a 20 Horas. ', 'upload_images/5103ec620915aac7e70303a454b3f9c4.jpg', '<p><strong>REGLAMENTO DE PARTICIPACI&Oacute;N </strong></p>\r\n\r\n<p><strong>&ldquo;Expohobby&rdquo; Fiestas y Decoraci&oacute;n.</strong></p>\r\n\r\n<p>Este reglamento toca los siguientes puntos:</p>\r\n\r\n<p>1 - Armado de la muestra.<br />\r\n2 - Desarme de la muestra.<br />\r\n3 - &Aacute;reas del evento.<br />\r\n4 - Servicios Incluidos.<br />\r\n5 - Opciones publicitarias.<br />\r\n6 - Concurso &ldquo;Expohobby&rdquo;.<br />\r\n7 &ndash; Pol&iacute;tica de reservas y devoluciones.<br />\r\n8 - Generalidades.<br />\r\n9 - Legal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1 - Armado de la muestra:</p>\r\n\r\n<p>Es importante respetar el cronograma de armado informado por el grupo organizador, este permitir&aacute; un &aacute;gil descargue de los fletes y el cuidado necesario de las piezas en exposici&oacute;n, rogamos respetar este cronograma respetando al resto de los expositores.</p>\r\n\r\n<p>El personal (mayores y/o menores de edad) que se encuentre afectado al armado, atenci&oacute;n y desarme del stand o mesa expositora se encontrar&aacute; bajo la responsabilidad f&iacute;sica y legal del titular responsable de la reserva.</p>\r\n\r\n<p>Si el expositor no ocupa su espacio el d&iacute;a asignado para el armado, la organizaci&oacute;n lo considerar&aacute; ausente de la muestra y&nbsp;dispondr&aacute; del mismo a su criterio, re-asign&aacute;ndolo a terceros o utiliz&aacute;ndolo para exposici&oacute;n de piezas, sin posibilidad de reclamo de ning&uacute;n tipo por parte del expositor.</p>\r\n\r\n<p>El stand consiste en un espacio delimitado por papeler&iacute;a divisoria, cuya dimension y ubicaci&oacute;n fue elegida en el momento de la reserva.</p>\r\n\r\n<p>La altura m&aacute;xima de dicha papeler&iacute;a es de 2,40 mts. No est&aacute; permitido exceder esta medida con muebles, mercader&iacute;a y/o carteles.</p>\r\n\r\n<p>La participaci&oacute;n obliga al expositor a ocupar el espacio que le ha sido asignado y a mantenerlo debidamente presentado y atenderlo por personal capacitado que asista al p&uacute;blico en los horarios dispuestos por la organizaci&oacute;n hasta la clausura de la misma.</p>\r\n\r\n<p>La muestra abre puntualmente en el horario establecido y la no presencia de personal en el stand en dicho horario no admite reclamos por faltantes de mercader&iacute;a que no podr&aacute;n imputarse al organizador a pesar de tener personal de seguridad en la muestra.</p>\r\n\r\n<p>Ante la necesidad de requerir ayuda del personal de mantenimiento, solic&iacute;telo al grupo organizador</p>\r\n\r\n<p>2 - Desarme de la muestra:</p>\r\n\r\n<p>El desarme se realizar&aacute; el &uacute;ltimo d&iacute;a de la muestra a partir de las 20:00 hrs. <strong>NO ESTA PERMITIDO COMENZAR A DESMONTAR ANTES DE LA HORA INDICADA Y ANUNCIADO POR LOS ORGANIZADORES.</strong></p>\r\n\r\n<p>El ingreso de personal para el desarme ser&aacute; permitido a partir de las 20.30 Hs. Como as&iacute; tambi&eacute;n el retiro de cajas y muebles.</p>\r\n\r\n<p>Los espacios deben devolverse en las mismas condiciones que se recibieron, todo da&ntilde;o causado en las instalaciones podr&aacute;n ser derivados a la empresa causante del mismo.</p>\r\n\r\n<p>3 - &Aacute;reas del evento:</p>\r\n\r\n<p>Existen dos &aacute;reas dentro del evento:</p>\r\n\r\n<p>Empresas y Talleres: Estos espacios est&aacute;n a disposici&oacute;n de las empresas ocupantes para realizar las tareas de comercializaci&oacute;n de insumos, piezas terminadas, actividades demostrativas o participativas.</p>\r\n\r\n<p>&Aacute;rea expositora: Este espacio est&aacute; destinado a la exhibici&oacute;n de muestras terminadas, <strong>QUEDANDO EXPRESAMENTE PROHIBIDA LA COMERCIALIZACI&Oacute;N DE DICHO MATERIAL</strong>. Pudiendo publicitar su actividad a trav&eacute;s de folletos alusivos. Estas mesas cuentan con manteler&iacute;a&nbsp;b&aacute;sica&nbsp;<strong>SIN INSTALACI&Oacute;N ELECTRICA.</strong> Toda la ornamentaci&oacute;n no podr&aacute;&nbsp;exceder los bordes de la mesa ni superar 1,2 mts. de altura.</p>\r\n\r\n<p>4 - Servicios incluidos:</p>\r\n\r\n<p>En Stands Comerciales:</p>\r\n\r\n<p>Acceso a conexi&oacute;n el&eacute;ctrica, iluminaci&oacute;n general del sal&oacute;n, 2 sillas, 1 mesa (<strong>SIN MANTEL)</strong></p>\r\n\r\n<p>En Stands de Talleres:</p>\r\n\r\n<p>Acceso a conexi&oacute;n el&eacute;ctrica, iluminaci&oacute;n general del sal&oacute;n, 6 sillas, 1 mesa (<strong>SIN MANTEL)</strong></p>\r\n\r\n<p>Mesas Expositora:</p>\r\n\r\n<p>Mesa redonda de 1,5 mts. De di&aacute;metro con manteler&iacute;a b&aacute;sica.</p>\r\n\r\n<p>Servicios comunes:</p>\r\n\r\n<p>Limpieza nocturna de los espacios comunes, Guardarropas, Valet de ba&ntilde;os, seguridad, bombero, cobertura m&eacute;dica, seguro.</p>\r\n\r\n<p>5 - Opciones publicitarias:</p>\r\n\r\n<p>Programa &ldquo;Expohobby&rdquo;: Opci&oacute;n preferencial de anunciar en el programa de la muestra.</p>\r\n\r\n<p>Todas las empresas participantes recibir&aacute;n entradas de cortes&iacute;a sin cargo.</p>\r\n\r\n<p>En la p&aacute;gina www.expohobby.net se ha incluido un plano de c&oacute;mo llegar a la muestra, puede agregarlo a su p&aacute;gina web cuando anuncie su presencia en la muestra.</p>\r\n\r\n<p>6 - Concurso &ldquo;EXPOHOBBY&rdquo;</p>\r\n\r\n<p>Durante el primer d&iacute;a del evento se har&aacute; entrega a todo el p&uacute;blico visitante de un cup&oacute;n para la votaci&oacute;n de las tres categor&iacute;as concursantes: Obra en exposici&oacute;n m&aacute;s destacada / Mesa en exposici&oacute;n mejor ambientada / Stand mejor decorado.</p>\r\n\r\n<p>7 &ndash; Pol&iacute;tica de reservas y devoluciones:</p>\r\n\r\n<p>La reserva del espacio elegido se realizar&aacute; dentro de la fecha estipulada por los organizadores, la cancelaci&oacute;n del saldo de los espacios y servicios contratados ser&aacute; con un plazo de 15 d&iacute;as anteriores al evento correspondiente. Toda devoluci&oacute;n de reserva o pago anticipado se realizar&aacute; una vez finalizado el evento y mediante la siguiente escala de descuento:</p>\r\n\r\n<p>(180 d&iacute;as: - 20%), (150 d&iacute;as: -30%), (120 d&iacute;as: -40%), (90 d&iacute;as: -50%) pasado este plazo no se realizar&aacute;n devoluciones, sin lugar a reclamo.</p>\r\n\r\n<p>8 - Generalidades:</p>\r\n\r\n<p>8.1 Al colocar paneles divisorios deben estar prolijamente pintados tanto del lado interior de su stand como del lado que enfrenta al stand vecino.</p>\r\n\r\n<p>8.2 Los pasillos comunes no pueden ser interrumpidos en su circulaci&oacute;n, si va a dar demostraciones considere el espacio necesario para no interrumpir el tr&aacute;nsito del p&uacute;blico. La gente deber&aacute; estar dentro del per&iacute;metro del stand.</p>\r\n\r\n<p>8.3 Toda la mercader&iacute;a deber&aacute; estar dentro de su stand y&nbsp;no podr&aacute; sobresalir ni apoyarse en los espacios de circulaci&oacute;n.&nbsp;Tampoco se podr&aacute; colgar ning&uacute;n elemento publicitario fuera del per&iacute;metro del stand.</p>\r\n\r\n<p>8.4 No est&aacute; permitido entregar volantes o cualquier otro tipo de publicidad ni vender fuera del espacio de su stand.</p>\r\n\r\n<p>8.5 El ingreso de mercader&iacute;a estar&aacute; prevista 1 hora antes del horario de apertura de cada d&iacute;a del evento.</p>\r\n\r\n<p>8.6 No se puede obstaculizar con elementos pesados las instalaciones de emergencias como salidas, extinguidores de fuego y zonas comunes de circulaci&oacute;n.</p>\r\n\r\n<p>8.7 Durante toda la muestra el personal de la organizaci&oacute;n estar&aacute; a su disposici&oacute;n para solucionar eventuales inconvenientes, podr&aacute;n pedir asistencia en la zona de boleter&iacute;a o el sector de informes y locuci&oacute;n.</p>\r\n\r\n<p>8.8 La muestra cuenta con un locutor ubicado en un espacio com&uacute;n, tenga bien la precauci&oacute;n de armar un listado de anuncios con la hora requerida para facilitar su trabajo.</p>\r\n\r\n<p>8.9 Recuerde que todo elemento de embalaje que Ud. deje en los pasillos comunes, ser&aacute;n retirados como basura al finalizar el d&iacute;a.</p>\r\n\r\n<p>9 - Legal:</p>\r\n\r\n<p>9.1 Los expositores est&aacute;n obligados a asegurar el material y mercader&iacute;a que expongan as&iacute; sean de su propiedad o de terceros y renuncian a toda acci&oacute;n legal para obtener indemnizaci&oacute;n por accidentes personales, incendios, tempestad, hurtos, inundaci&oacute;n, explosi&oacute;n, conmoci&oacute;n civil, sabotaje, atentado u otro siniestro en contra de los organizadores.</p>\r\n\r\n<p>9.2 El expositor no podr&aacute; ceder, arrendar ni sub-alquilar total&nbsp;o parcialmente el espacio adquirido. En la eventualidad de que esto sucediere, la organizaci&oacute;n puede invitar a retirarse a las personas que no tienen autorizaci&oacute;n para comerciar dentro de los stands.</p>\r\n\r\n<p>9.3 Solo est&aacute;n autorizados a realizar ventas dentro de la muestra, aquellas personas que hayan comprado un stand.</p>\r\n\r\n<p>9.4 El expositor se obliga al pago de los da&ntilde;os que pudieran derivarse de su responsabilidad extracontractual frente a terceros sin que la organizaci&oacute;n asuma responsabilidad alguna sobre dichos hechos.</p>\r\n\r\n<p>9.5 Los expositores no podr&aacute;n modificar las condiciones expresadas en este Reglamento y deben acatarlas desde el momento en que abonan el derecho de reserva, reconociendo este momento como una declaraci&oacute;n jurada del conocimiento del presente Reglamento.</p>\r\n\r\n<p>9.6 El lugar elegido para el desarrollo de la muestra, cumple con todos los requisitos exigidos por la Municipalidad de la Ciudad aut&oacute;noma de Buenos Aires con respecto a seguridad e incendios. Preste atenci&oacute;n a la ubicaci&oacute;n de los matafuegos y salidas de emergencias m&aacute;s cercanas a su ubicaci&oacute;n. En la eventualidad de un imprevisto, nuestro personal dar&aacute; las instrucciones y lo dirigir&aacute; a las salidas de emergencia.</p>\r\n\r\n<p>9.7 Contamos con un servicio de vigilancia, no obstante ni este servicio ni los organizadores asumen responsabilidad por los objetos que se pierdan dentro de los stands, rogamos prever espacio donde ubicar los valores y elementos personales a resguardo. No est&aacute; permitida la permanencia en los stands despu&eacute;s de media hora posterior al cierre. Rogamos muy especialmente este tema por la seguridad de todos los elementos dentro de los stands. No comprometa al personal de seguridad con una permanencia m&aacute;s all&aacute; de este horario.</p>\r\n\r\n<p>9.8 El Reglamento toma en cuenta el mejor funcionamiento y las necesidades de todos los expositores.</p>\r\n\r\n<p>9.9 Las empresas que realicen una actividad comercial, recuerden llevar siempre su comprobante de inscripci&oacute;n tributaria y su correspondiente talonario de facturas.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>LA COMPRA Y PAGO DEL STAND COMERCIAL O MESA EXPOSITORA IMPLICA LA ACEPTACI&Ograve;N DE ESTE REGLAMENTO Y TENDR&Aacute; EFECTO LEGAL COMO UN CONTRATO. EL NO CUMPLIMIENTO DE ALGUNA CLAUSULA QUE FIGURE EN ESTE REGLAMENTO, HABILITAR&Aacute; AL ORGANIZADOR A EFECTUAR LA SANCI&Oacute;N CORRESPONDIENTE</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ante cualquier consulta, no dude en contactarse con la organizaci&oacute;n</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Gracias.</p>\r\n', '', '', '', '', '', '', '', '2014-09-18', '2014-09-20', 'Publicado'),
